  input: 'TEXT,F3XA,,"In response to your request for additional information, 21st
    Century Democrats (The Committee) responds as follows:  1.Schedule H1 of the report
    discloses disbursements for the administrative category on a ratio consistent
    with that disclosed on Schedule H1 for the 2004 election cycle. The Committee
    amended its ration on the July monthly report, changing the ration to 10 % federal
    and 90% non-federal to conform more closely to its actual anticipated activity.
    2. Scedule A of the report discloses a receipts of $101,781.12 from the ''21st
    Century Democrats non-federal Acct.''. The federal account made payment in this
    amount for direct non-federal activity which was erroneously disclosed on Schedule
    H-4 as a Committee administrative expense. To comply with applicable state law,
    the appropriate Committee non-federal account reimbursed the federal account in
    this amount. The Committee will amend its report to show the correct allocation
    ratio for these disbursements. 3. All of these expenditures are involved with
    The Committee''s own operations and none were made on behalf of any specifically
    identified candidate. 4. The Committee has amended its report to disclose all
    reportable memo entries."'
